import React from "react";
import {Link} from 'react-router-dom';

function TraingSidebar(){
    const teacherId=localStorage.getItem('teacherId')
    return(
        <div className="card">
            <div className="list-group list-grou-flush ">
                <Link to={`/trainer-dashboard/`+teacherId} className="list-group-item list-group-item-action">Training Dashboard</Link>
                <Link to={`/training-details/`+teacherId} className="list-group-item list-group-item-action">Training Details</Link>
                <Link to="/teacher-courses" className="list-group-item list-group-item-action">Scheduled Courses</Link>
                <Link to="/teacher-courses" className="list-group-item list-group-item-action">Recommended Courses</Link>
            </div>
        </div>
    )
}

export default CorpSidebar;
